import React, { useState, useEffect } from "react";
// import Artist from "./Artist";

export default function Tracks({ tracklist }) {
  return (
    <div>
      <ul className="track-list">
        {tracklist &&
          tracklist.map((el) => {
            return (
              <div>
                <p>{el.artists[0].name}</p>
                <li>{el.title}</li>
              </div>
            );

            // console.log()
            // <Artist artists= {el.artists}></Artist>
          })}
      </ul>
    </div>
  );
}
